import { setView, setDate } from "../../../../shared/setNumber/setNumber.js";
const Video = (props) => {
  const { title, thumbImg, userImg, userName, thumbView, thumbDate } = props;
  return (
    <article className={css.group}>
      <img className={css.img} src={thumbImg} />
      <div className={css.title}>
        <img className={css.user_img} src={userImg} />
        <div>
          <p className={css.text}>{title}</p>
          <p className={css.text_name}>{userName}</p>
          <div className={css.text_small_box}>
            <p className={css.text_small}>{setView(thumbView)}</p>
            <p className={css.text_small}>â€¢</p>
            <p className={css.text_small}>{setDate(thumbDate)}</p>
          </div>
        </div>
      </div>
    </article>
  );
};

export default Video;
